import React from 'react';
/* 
Props Object
{
    name: 'Ellie'
    favoriteShow
}
*/

const Greeter = props => {
    return (
        <div>
            <h1>My name is {props.name} and my favorite show is {props.favoriteShow}</h1>
        </div>
    );
}

export default Greeter;
